description:
Discover the &quot;essence of female domination&quot; in Rocco Siffredi&amp;#039;s big Prime Evil release for Spring. The crazy plot involves an ancient game, begun by strange tribes in deepest Africa, revolving around orgiastic gatherings, sexual slavery and mysterious vials to be filled with women&amp;#039;s juices. A modern-day Mike Chapman discovers an antique book that leads him to create a wife-swapping network in an attempt to bring together the mystical substance of Eskade. Along the way, there are mice, scorpions, beautiful women, toilet sex, gangbangs, Omar Galanti in semi-drag, and lots of sodomy. Written by Gabriel Zero, this full-length big-budget feature includes 36 minutes of behind-the-scenes making-of footage.

Cast
Peaches, Omar Galanti, Lucky, Loona Luxx, Black Angelika, Hannah Hunter, Caty Cambel, Camilla Ken, Cayenne Klein, Grinch, Totti, Nico Blade, Laura Picasso, Tony Brooklyn, Madison Parker, Tomi, Dorina Golden, Tibi, Britney 2, Steve Cross, Julio Gs, Stephanie Lahay, Juliette Shyn, Sofia Valentine, Cecilia Vega, Andreas Wohldrann, Rocco Siffredi, Zenza Raggi


